eval("__webpack_require__.r(__webpack_exports__);\n/* harmony default export */ __webpack_exports__[\"default\"] = ({\n  testString: 'hello',\n  site: {\n    title: ' | Michaela Jaritz | Dynamic Speaker, Teacher, Author',\n    slogan: {\n      title: 'Dynamic Speaker, Teacher, Author',\n      line1: 'The mind, once stretched',\n      line2: 'by a new idea, never returns',\n      line3: 'to its original dimension.',\n      line4: 'What lies behind us and what lies before us are tiny matters compared to what lies within us',\n      line5: ' - Oliver Wendell Homes'\n    },\n    description: 'Training, Coaching und Moderation für Sie persönlich oder für Teams und Gruppen, systemisch, mit der Symbolon-Methode©.'\n  },\n  pages: {\n    willkommen: {\n      title: 'About',\n      content: {\n        fresh: 'Erfrischend.',\n        individual: 'What lies behind us and what lies before us are tiny matters compared to what lies within us',\n        sustainable: ' - Oliver Wendell Homes',\n        subtitle: 'Training. Coaching. Moderation.',\n        quote: 'We are Confronted With Insurmountable Opportunities',\n        greetings: 'Are you living to your fullest potential? Are there buried dreams, abandoned goals, untapped potential that you would like to rejuvenate? I Work With People to Motivate and Equip Them to Maximize Their Potential to Be The Best That They Can Be! For information on workshops and key note addresses, or to see how I can help you or your team, please contact me.'\n      }\n    },\n    idee: {\n      title: 'Topics',\n      content: {\n        titleTraining: 'Training.',\n        titleCoaching: 'Coaching.',\n        titleModeration: 'Moderation.',\n        subtitle: 'Für Ihre Potentialentfaltung.',\n        textIntro: \"Stellen Sie sich vor, Sie schauen in ein Kaleidoskop. Dieses „Fernrohr“ mit seinen bunten und schillernden Glasteilchen spiegelt im übertragenen Sinne Ihr ganz besonderes und individuelles Potential.  <br /> <br /> Manchmal reicht schon eine leichte Drehung und Sie erhalten sofort neue und überraschende Ein- und Ausblicke. Eine frische Perspektive auf vermeintlich Bekanntes entsteht. Vorhandene Muster lösen sich auf und neue werden sichtbar.  <br /> <br /> Meine Trainings und Coachings bringen Ihr individuelles Potential ans Licht und lassen es sich entfalten. Die Möglichkeiten sind unendlich – genau wie in einem Kaleidoskop.\",\n        // eslint-disable-line\n        titleMakeVisible: 'Sichtbar machen.',\n        textMakeVisible: 'Mit der <a href=\"/fokus\" title=\"Im Fokus - Was ist die Symbolon Methode?\">Symbolon-Methode®</a>, dem Coaching mit Kunstwerken, wird bisher Unsichtbares sichtbar und Sie erhalten verblüffend schnell neue Einblicke und Lösungsansätze.',\n        // eslint-disable-line\n        titleMakeRoom: 'Platz machen.',\n        textMakeRoom: \"Damit Neues entstehen kann, darf Bisheriges Platz machen. Ich begleite Sie dabei, herauszufinden, was das genau für Sie ist.\",\n        // eslint-disable-line\n        titleMakePossible: 'Möglich machen.',\n        textMakePossible: \"Potentialentfaltung ist ein Verb. Damit Sie ins Handeln kommen, treffen Sie mit sich eine Vereinbarung. Auch dabei begleite ich Sie.\" // eslint-disable-line\n\n      }\n    },\n    angebot: {\n      title: 'Audio/ Video',\n      content: {\n        subtitle: 'Mein Angebot.',\n        titlePersonalOffer: 'Für Sie persönlich:',\n        textPersonalOffer: 'Business Coaching mit Kunstwerken und der <a href=\"/fokus\" title=\"Im Fokus - Was ist die Symbolon Methode?\">Symbolon-Methode®</a> – frappierend schnell im Erkenntnisgewinn und nachhaltig in der Umsetzung.',\n        // eslint-disable-line\n        titleTeamOffer: 'Für Teams & Gruppen:',\n        textTeamOffer: 'Individuelle Trainings, Team-Entwicklung und Moderationen, systemisch fundiert, mit der <a href=\"/fokus\" title=\"Im Fokus - Was ist die Symbolon Methode?\">Symbolon-Methode®</a>, Schwerpunkt Persönlichkeitsentwicklung für Fach- und Führungskräfte sowie Vertriebs- und Kommunikationsthemen.',\n        // eslint-disable-line\n        symbolonProfilTitle: 'Symbolon-Profil',\n        symbolonProfilText: 'Das Symbolon-Profil wird von Ihnen online ausgefüllt und beinhaltet fünf unterschiedliche Bereiche. Ihre daraus resultierende schriftliche 30-seitige Potentialanalyse sowie Ihre individuelle Fragestellung bilden den Rahmen für unser gemeinsames Coaching-Gespräch, das etwa zwei Stunden dauert. Ihr persönlicher Maßnahmenplan, Ihre Vereinbarung mit sich selbst, garantiert die nachhaltige Umsetzung.',\n        symbolonProfilIntensiveTitle: 'Symbolon-Profil Intensiv',\n        symbolonProfilIntensiveText: 'Das Symbolon-Profil Intensiv beinhaltet 17 unterschiedliche Bereiche und wird handschriftlich ausgefüllt. Die daraus resultierende schriftliche Potentialanalyse, Ihr persönliches 75-seitiges Buch, sowie Ihre individuelle Fragestellung bilden den Rahmen für unser gemeinsames Coaching-Gespräch, das an zwei Terminen mit jeweils zwei Stunden stattfindet. Ihr persönlicher Maßnahmenplan, Ihre Vereinbarung mit sich selbst, garantiert die nachhaltige Umsetzung.',\n        businessCoachingTitle: 'Individuell für Sie kuratierte firmeninterne Trainings',\n        businessCoachingText: \"Basierend auf Ihrer konkreten Situation und Ihren Bedürfnissen stelle ich die Inhalte für Ihr firmeninternes Training oder Ihren Workshop zusammen. Vertriebliche und kommunikative Methodenkompetenz sowie persönlichkeitsentwickelnde Themen stehen dabei im Mittelpunkt. In meinen Trainings ergeben theoretische Grundlagen, Möglichkeiten zur Selbstanalyse und -reflexion und viel Praxis-Übungen einen Mix, der ein lernförderndes Umfeld und eine nachhaltige Umsetzung der Inhalte garantiert.<br /><br />Für die weitere Nachhaltigkeit in der Umsetzung hat sich das „+1-Konzept“ bewährt. Mit zeitlichem Abstand von 6 bis 8 Wochen zum Training oder Workshop findet ein Folgetag statt, bei dem die Teilnehmer den Praxistransfer des Gelernten reflektieren, Inhalte vertiefen und weiter üben.\",\n        // eslint-disable-line\n        symbolonTeamTitle: 'Symbolon Team-Profil',\n        symbolonTeamText: \"Bei einer Teamentwicklung mit dem Symbolon-Team-Profil füllen alle Teammitglieder ihr individuelles Symbolon-Profil bzw. Symbolon-Profil Intensiv aus. In der Voranalyse fasse ich alle Einzelprofile in einem Teamprofil zusammen. Im Workshop werden dann die Kernthemen des Teams interaktiv bearbeitet, gemeinsam werden Lösungen entwickelt und Ziele vereinbart. Vor und/oder nach dem Workshop sind Einzel-Coachings eine sinnvolle Ergänzung.\",\n        // eslint-disable-line\n        art4reflectionTitle: 'Symbolon Art4Reflection',\n        art4reflectionText: \"Das Coaching im Museum findet als offene Veranstaltung für Gruppen mit max. 10 Teilnehmern statt oder exklusiv für Ihr Team. In der etwa 1,5-stündigen Führung erleben Sie einen Reflexionsprozess mit drei unterschiedlichen Kunstwerken.  <br /><br /><strong>Ab sofort wieder:</strong> Treffen Sie mich bei den Führungen in Leipzig, im Museum der bildenden Künste. Die aktuellen Termine für Gruppen-Führungen finden Sie auf meinem LinkedIn-Profil oder einfach per Email an <a href='michaela.jaritz@outlook.de'>michaela.jaritz@outlook.de</a> anfragen.<br /><br />Gern können wir uns auch zum Einzel-Coaching im Museum treffen, eine Online-Kunstpause gestalten oder in Ihrem Unternehmen eine Art4Reflection-Führung gestalten, wenn Sie eigene Kunstwerke im Haus haben.<br /><br />Symbolon Art4Reflection ist eine internationale Initiative, weitere Informationen unter: <a href='https://symbolon.com/event' title='Symbolon Art4Reflection - Quick dive for your brilliance' target='_blank' rel='noopener'>symbolon.com/event</a>\" // eslint-disable-line\n\n      }\n    },\n    fokus: {\n      title: 'Books',\n      content: {\n        subtitle: 'Was mich leitet.',\n        titleArt: 'Die Kunst.',\n        textArt: \"Kunst ist zentrales Element meiner Arbeit: Kunstwerke zur Selbstreflexion. Lebenskunst als Grundfähigkeit eines jeden Menschen. Die Handwerkskunst, ein für Sie zugeschnittenes Training zu konzipieren. Die Kunst, mit Sprache zu spielen, zu gestalten.\",\n        // eslint-disable-line\n        titleHuman: 'Der Mensch.',\n        textHuman: \"Für mich ist jeder Mensch eine Führungspersönlichkeit, denn Führung beginnt immer mit der eigenen Person, mit der eigenen Lebensführung. Die Fähigkeit zur Selbstreflexion ist dabei zentrale Schlüsselkompetenz – vor allem mit Blick auf den immer schneller werdenden Wandel und die digitale Transformation.\",\n        // eslint-disable-line\n        titleMethod: 'Die Methode.',\n        textMethod: 'Ich arbeite auf Basis meiner systemischen Trainer-Ausbildung und der Symbolon-Methode®. Immer mit dem Blick auf die bereits vorhandenen Ressourcen und die Möglichkeiten zur Potentialentfaltung.<br /><br />Die systemische Betrachtungsweise sieht einzelne Personen als Teil eines größeren Gesamtsystems, dessen Elemente in wechselseitigem Zusammenhang miteinander stehen und sich gegenseitig beeinflussen. Meine systemische Grundhaltung stärkt Ihre Fähigkeit zur Selbstverantwortung, ist wertschätzend und ganzheitlich.<br /><br />Die Symbolon-Methode® ist weltweit das führende Reflexionsinstrument für Persönlichkeitsentwicklung. Bis heute wurden über 10.000 Symbolon-Profile in Coachings und Trainings angewendet.<br /><br />Im Unterschied zu herkömmlichen Analyseinstrumenten basiert die Symbolon-Potentialanalyse auf der Reflexion von Kunstwerken, Archetypen und Symbolen. Weitere Details unter <a href=\"https://www.symbolon.com/symbolon-methode\" target=\"_blank\" rel=\"noopener\">https://www.symbolon.com/symbolon-methode.</a>' // eslint-disable-line\n\n      }\n    },\n    'ueber-mich': {\n      title: 'Testimonials',\n      content: {\n        titleExperience: 'Erfahren.',\n        textExperience: '25 Jahre Marketing- und Vertriebserfahrung bei der Firma Microsoft Corporation (Redmond, USA) und Microsoft Deutschland GmbH. Sattelfest im Großunternehmen und in der Führung von (virtuellen) Teams. Systemische Trainerin (zertifiziert von der European Coaching Association, ECA) und Symbolon-Spezialistin (akkreditiert von der International Coach Federation, ICF).',\n        titleLanguages: 'Sprachverliebt.',\n        textLanguages: 'Als Diplom-Übersetzerin baue ich mit Sprache Brücken: zu Ihnen, zu Ihrem Team, in Ihrer Gruppe. Trainings und Coachings auf Deutsch und Englisch.',\n        titleHuman: 'Menschlich.',\n        textHuman: 'Ich begeistere mich für lebenslanges Lernen. Eigenverantwortung und Wertschätzung sind für mich wichtige Werte. Humor, ein pragmatischer Optimismus und eine positive Grundeinstellung zeichnen mich aus.'\n      }\n    },\n    kontakt: {\n      title: 'Calendar',\n      content: {\n        subtitle: 'Training. Coaching. Moderation.',\n        title: 'Michaela Jaritz',\n        contactInformations: 'The Westin Business Center <br />Gerberstr. 15 <br />04105 Leipzig <br /> <br /><a href=\"mailto:michaela.jaritz@outlook.de\" title=\"professional email of Michaela Jaritz\">michaela.jaritz@outlook.de</a><br />+49 175 5844 738',\n        // eslint-disable-line\n        finalSentence: 'Folgen Sie mir gern auf den sozialen Medien, dort veröffentliche ich jede Woche einen Reflexionsimpuls für Sie zur Inspiration. Coaching mit einem Kunstwerk in verdichteter Form.<br/><br/>Oder schreiben Sie mir, rufen Sie mich an oder treffen Sie mich bei einer der nächsten <a href=\"/angebot\">Symbolon Art4Reflection-Veranstaltungen</a>. Ich freue mich auf Sie.'\n      }\n    },\n    kooperationen: {\n      title: 'Training',\n      content: {\n        title: 'Kooperationen.',\n        text: 'Ein großes Kunstwerk entsteht oft in der Zusammenarbeit. Ich arbeite im Netzwerk sehr gern und erfolgreich mit folgenden Menschen und Unternehmen zusammen:',\n        list: '<ul><li><a rel=\"noopener\" target=\"_blank\" href=\"https://www.symbolon.com\" title=\"Ausbildungszentrum für Reflexionskompetenz in der Wirtschaft\">Symbolon AG</a></li><li><a rel=\"noopener\" target=\"_blank\" href=\"http://www.methodenberatung-jahn.de/\" title=\"Methodenberatung, Marktforschung und Multivariate Datenanalyse Leipzig\">Judith Jahn Methodenberatung</a></li></ul>',\n        // eslint-disable-line\n        thanks: 'Mein herzlicher Dank für die professionelle Zusammenarbeit, die mir viel Freude gemacht hat, geht an <a rel=\"noopener\" target=\"_blank\" href=\"https://vogelino.com\" title=\"UI and UX Designer based in Berlin\">Lucas Vogel</a> für das Design und die Umsetzung dieses Webauftritts und an <a href=\"http://www.lichtbildnerei-leipzig.de\" title=\"Professionelle Lichtbildnerei\" target=\"_blank\" rel=\"nofollow noopener\">Susanne Stark</a>, Die Lichtbildnerei für die Portrait-Aufnahmen.'\n      }\n    },\n    impressum: {\n      title: '',\n      text: '# Impressum.\\n## Angaben gemäß § 5 TMG\\n\\nMichaela Jaritz  \\nGerberstr. 15  \\n04105 Leipzig  \\n\\n## Vertreten durch:\\nMichaela Jaritz  \\n  \\n**Telefon**: 0175-5844738  \\n**E-Mail**: [michaela.jaritz@outlook.de](\"mailto:michaela.jaritz@outlook.de\")  \\n**Umsatzsteuer-Identifikationsnummer**: DE310604321 (gemäß §27a Umsatzsteuergesetz)\\n## Haftung für Inhalte\\nDie Inhalte unserer Seiten wurden mit größter Sorgfalt erstellt. Für die Richtigkeit, Vollständigkeit und Aktualität der Inhalte können wir jedoch keine Gewähr übernehmen. Als Diensteanbieter sind wir gemäß § 7 Abs.1 TMG für eigene Inhalte auf diesen Seiten nach den allgemeinen Gesetzen verantwortlich. Nach §§ 8 bis 10 TMG sind wir als Diensteanbieter jedoch nicht verpflichtet, übermittelte oder gespeicherte fremde Informationen zu überwachen oder nach Umständen zu forschen, die auf eine rechtswidrige Tätigkeit hinweisen. Verpflichtungen zur Entfernung oder Sperrung der Nutzung von Informationen nach den allgemeinen Gesetzen bleiben hiervon unberührt. Eine diesbezügliche Haftung ist jedoch erst ab dem Zeitpunkt der Kenntnis einer konkreten Rechtsverletzung möglich. Bei Bekanntwerden von entsprechenden Rechtsverletzungen werden wir diese Inhalte umgehend entfernen.\\n\\n## Haftung für Links\\nUnser Angebot enthält Links zu externen Webseiten Dritter, auf deren Inhalte wir keinen Einfluss haben. Deshalb können wir für diese fremden Inhalte auch keine Gewähr übernehmen. Für die Inhalte der verlinkten Seiten ist stets der jeweilige Anbieter oder Betreiber der Seiten verantwortlich. Die verlinkten Seiten wurden zum Zeitpunkt der Verlinkung auf mögliche Rechtsverstöße überprüft. Rechtswidrige Inhalte waren zum Zeitpunkt der Verlinkung nicht erkennbar. Eine permanente inhaltliche Kontrolle der verlinkten Seiten ist jedoch ohne konkrete Anhaltspunkte einer Rechtsverletzung nicht zumutbar. Bei Bekanntwerden von Rechtsverletzungen werden wir derartige Links umgehend entfernen.\\n\\n## Urheberrecht\\nDie durch die Seitenbetreiber erstellten Inhalte und Werke auf diesen Seiten unterliegen dem deutschen Urheberrecht. Die Vervielfältigung, Bearbeitung, Verbreitung und jede Art der Verwertung außerhalb der Grenzen des Urheberrechtes bedürfen der schriftlichen Zustimmung des jeweiligen Autors bzw. Erstellers. Downloads und Kopien dieser Seite sind nur für den privaten, nicht kommerziellen Gebrauch gestattet. Soweit die Inhalte auf dieser Seite nicht vom Betreiber erstellt wurden, werden die Urheberrechte Dritter beachtet. Insbesondere werden Inhalte Dritter als solche gekennzeichnet. Sollten Sie trotzdem auf eine Urheberrechtsverletzung aufmerksam werden, bitten wir um einen entsprechenden Hinweis. Bei Bekanntwerden von Rechtsverletzungen werden wir derartige Inhalte umgehend entfernen.\\n\\n## Datenschutz\\nDie Nutzung unserer Webseite ist in der Regel ohne Angabe personenbezogener Daten möglich. Soweit auf unseren Seiten personenbezogene Daten (beispielsweise Name, Anschrift oder eMail-Adressen) erhoben werden, erfolgt dies, soweit möglich, stets auf freiwilliger Basis. Diese Daten werden ohne Ihre ausdrückliche Zustimmung nicht an Dritte weitergegeben.\\nWir weisen darauf hin, dass die Datenübertragung im Internet (z.B. bei der Kommunikation per E-Mail) Sicherheitslücken aufweisen kann. Ein lückenloser Schutz der Daten vor dem Zugriff durch Dritte ist nicht möglich.\\nDer Nutzung von im Rahmen der Impressumspflicht veröffentlichten Kontaktdaten durch Dritte zur Übersendung von nicht ausdrücklich angeforderter Werbung und Informationsmaterialien wird hiermit ausdrücklich widersprochen. Die Betreiber der Seiten behalten sich ausdrücklich rechtliche Schritte im Falle der unverlangten Zusendung von Werbeinformationen, etwa durch Spam-Mails, vor.\\n\\nWebsite Impressum erstellt durch [impressum-generator.de](\"http://www.impressum-generator.de\") von der [Kanzlei Hasselbach](\"http://www.kanzlei-hasselbach.de/\")'\n    }\n  }\n});//# sourceURL=[module]\n//# sourceMappingURL=data:application/json;charset=utf-8;base64,\n//# sourceURL=webpack-internal:///./src/texts/de-DE.ts\n");

